            function showMovie(element) {
              var id = element.getAttribute("videoID");
              var video = document.getElementById(id);
              video.style.display = "block";
              video.style.opacity = 1;
              element.style.display = "none";

              video.play();
              video.onended = function () {
                video.onended = null;
                video.style.opacity = 0;
                video.addEventListener("transitionend", videoDisappar);
                video.addEventListener("webkitTransitionEnd", videoDisappar);
              }

              function videoDisappar() {
                video.removeEventListener("transitionend", videoDisappar);
                video.removeEventListener("webkitTransitionEnd", videoDisappar);
                video.ontransitionend = null;
                video.style.display = "none";
                element.style.display = "block";
              }
            }
